import React from 'react';
import '../src/components/Header.css';
import Header from './components/Header';
import img1 from './components/001.jpg';

import img2 from './components/002.jpg';
import img3 from './components/003.jpg';
import img4 from './components/004.jpg';
import img5 from './components/005.jpg';
import img6 from './components/006.jpg';
// import './img.css'

import Slider from "react-slick";
var settings = {
  dots: true,
  infinite: true,
  speed: 50,
  slidesToShow: 1,
  slidesToScroll: 1
};
function App() {
  return (
    <div className="App r">
      <Header />
      <div className="Content">
          <Slider {...settings} >
            <div >
            <img src={img1} className='imageResize'/>
            </div>
            <div>
            <img src={img2}className='imageResize' />
              
            </div>
            <div>
            <img src={img3} className='imageResize'/>
            
            </div>
            <div>
            <img src={img4} className='imageResize'/>
          
            </div>
            <div>
            <img src={img5} className='imageResize'/>
              
            </div>
            <div>
            <img src={img6} className='imageResize'/>
            
            </div>
          </Slider>      

        <p>42 is the answer to everything...</p>
      </div>
    </div>
  );
}

export default App;
